import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/getvideos').then((response) => {
      setVideos(response.data);
      console.log(response.data)
    })
  }, [])

  useEffect(() => {
    axios.get('https://www.youtube.com/channel/UCL7DDQWP6x7wy0O6L5ZIgxg').then((response) => {
      console.log(response.data)
    })
  }, [])


  return (
    <div className='App'>
      {videos.map((val, key) => {
        return <div key={key} className='videos-container'>
          <div className='video-container'>
            <a href={val.link}><img alt={val.title} src={val.thumb} className='thumb'/></a>
            <a href={val.link} className='link'><h2>{val.title}</h2></a>
          </div>
        </div>
      })}
    </div>
  )
}  
export default App;
